import './App.css';
import React, { useState } from "react";
import { Drawer, Button, List, ListItem, Typography } from "@material-ui/core";
import '@fontsource/roboto'
import TulipImg from "./assets/tulip";


function App() {

  const [openNav, setOpenNav] = useState(false);
  const [pageSelect, setPageSelect] = useState("home")

  const openDrawer = (e) => {
    e.preventDefault();
    setOpenNav(!openNav);
    console.log(openNav);
  }

  const openPage = (e, page) => {
    e.preventDefault();
    setPageSelect(page);
    setOpenNav(false)
    console.log(page);
  }

  const page = ["Contact", "About", "Prenatal", "Labor and Birth", "Newborn"]

  return (
    <div className="App">
      <Typography variant="h1">Love Your Birth</Typography>
      <Typography variant="h3">Midwifery</Typography>
      <Button onClick={openDrawer}>Menu</Button>
      <Drawer anchor="left" open={openNav}>
        <List>
          {page.map((item) => (
            <ListItem> 
              <Button onClick={e => openPage(e, item)}>{item}</Button>
            </ListItem>
          ))}
          <Button onClick={openDrawer}>Exit</Button>
        </List>
      </Drawer>
    </div>
  );
}

export default App;
